import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

export default function Navbar() {
  return (
    <nav className="navbar">
      <h1>DMRS</h1>
      <div className="nav-links">
        <Link to="/">Upload</Link>
        <Link to="/grant">Grant Consent</Link>
        <Link to="/download">Download</Link>
      </div>
    </nav>
  );
}
